function Caculator_Date(n,t){let i=t.getTime()-n.getTime();return i/864e5+1}function ConvertDateTimeUTC_Time_OnlyHour_Int(n){let t=new Date(n);return t.getHours()*60+t.getMinutes()}function HHMM_Int_To_Hour(n){return Math.floor(n/60)}function HHMM_Int_To_Minute(n){return n%60}function ConvertDT_To_StringYMD_Int(n){try{var t=new Date(n);let i=t.getMonth()+1,r=i<10?"0"+i:i,u=t.getDate()<10?"0"+t.getDate():t.getDate(),f=""+t.getFullYear()+r+u;return Number(f)}catch(i){return 19000101}}function Convert_DateInt_To_StringYMD(n){return n=n.toString(),n.substring(0,4)+"-"+n.substring(4,6)+"-"+n.substring(6,8)}function Convert_DateTime_To_YMD_Int(n){let t=new Date(n);return t.getFullYear()+("0"+(t.getMonth()+1)).slice(-2)+("0"+t.getDate()).slice(-2)}function YMD_Str_To_DateTime(n){return new Date(n.substring(0,4),Number(n.substring(4,6))-1,n.substring(6,8))}function Convert_Hour_Time_To_Int(n){let t=0,i=n.toString().split(":");return t+=Number(i[0])*60,t+Number(i[1])}function Convert_Hour_Time_To_Data_Time(n){let t=0,i=n.toString().split(":");return t+=Number(i[0])*100,t+Number(i[1])}function Convert_Int_To_Hour_Time(n){let t=n%1440,i=parseInt(t/60)>=10?parseInt(t/60):"0"+parseInt(t/60),r=parseInt(t%60)>=10?parseInt(t%60):"0"+parseInt(t%60),u="";return Number(r)==0&&(u=Number(i)>=12?'<span class="cal-timeline-item_unit" >PM<\/span>':'<span class="cal-timeline-item_unit">AM<\/span>'),'<span class="cal-timeline-item_hour">'+i+":"+r+"<\/span> "+u}function Convert_Hour_Time_Int_To_Time(n){let t=n,i=parseInt(t/60)>=10?parseInt(t/60):"0"+parseInt(t/60),r=parseInt(t%60)>=10?parseInt(t%60):"0"+parseInt(t%60);return i+":"+r+":00"}